-- | OBEXHeaderIdentifiers
--
-- Identifiers for OBEX Headers.
--
-- kOBEXHeaderIDName						Name of the object.  Null terminated unicode text.
--
-- kOBEXHeaderIDDescription				Text description of the object. Null terminated unicode text.
--
-- kOBEXHeaderIDReservedRangeStart			Range includes all combos of the upper 2 bits. Reserved.
--
-- kOBEXHeaderIDReservedRangeEnd			Range includes all combos of the upper 2 bits. Reserved.
--
-- kOBEXHeaderIDUserDefinedRangeStart		Range includes all combos of the upper 2 bits. User defined.
--
-- kOBEXHeaderIDUserDefinedRangeEnd		Range includes all combos of the upper 2 bits. User defined.
--
-- kOBEXHeaderIDType						Type of object - e.g. text, html, binary, etc. Null terminated ASCII text.
--
-- kOBEXHeaderIDTimeISO					Date/time stamp - ISO8601 version of time. (YYYYMMDDTHHMMSSZ)
--
-- kOBEXHeaderIDTarget						Name of service that operation is destined for.
--
-- kOBEXHeaderIDHTTP						An HTTP 1.x header.
--
-- kOBEXHeaderIDBody						A Chunk of the object body.
--
-- kOBEXHeaderIDEndOfBody					The last checking of the object body.
--
-- kOBEXHeaderIDWho						Identifies the OBEX applications, used to tell if talking to a peer.
--
-- kOBEXHeaderIDAppParameters				Extended application request and resposnse info.
--
-- kOBEXHeaderIDAuthorizationChallenge		Authentication digest-challenge.
--
-- kOBEXHeaderIDAuthorizationResponse		Authentication digest-reponse.
--
-- kOBEXHeaderIDObjectClass				OBEX Object - class of object.
--
-- kOBEXHeaderIDCount						Number of objects (used in Connect command).
--
-- kOBEXHeaderIDLength						The length of the object in bytes. 4 byte unsigned integer value.
--
-- kOBEXHeaderIDTime4Byte					Date/time stamp - 4 byte version for compat. only. Seconds since Jan 1, 1970.
--
-- kOBEXHeaderIDConnectionID				An identifier used for OBEX connection multiplexing.
--
-- kOBEXHeaderIDOBEX13WANUUID					Used to provide state information when layering OBEX over stateless networks. 16byte UUID.
--
-- kOBEXHeaderIDOBEX13ObjectClass				Used to reference the object class and properties. Byte Sequence.
--
-- kOBEXHeaderIDOBEX13SessionParameters		Byte sequence required for CreateSession, CloseSession and other OBEX commands.
--
-- kOBEXHeaderIDOBEX13SessionSequenceNumber	1-byte quantitied containing the current sequence number.
--
-- kOBEXHeaderIDOBEX13CreatorID				4-byte unsigned integer that identifies the creator of the object.
